pragma solidity ^0.4.2;
// import "openzeppelin-solidity/contracts/token/
// StandardToken.sol";

contract DappToken {
    uint public totalSupply;
    string public name = "Blochacoin";
    string public symbol = "BLC";
    uint8 public decimals = 18;

    mapping (address => uint) public balanceOf; 
    mapping (address => mapping(address => uint)) public allowance;
    address owner;
    constructor (uint _initialSupply) public {
        balanceOf[msg.sender] = _initialSupply;
        totalSupply = _initialSupply;
        owner = msg.sender;

    }
    event Approval (address indexed _owner, address indexed _spender, uint _value);   
    event Transfer (address indexed _from, address indexed _to, uint amount);
    function transfer (address _to, uint _value) public returns (bool success) {
        require(balanceOf[msg.sender] >= _value, "Not enough money");
        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;
        emit Transfer (msg.sender, _to, _value);
        return true;
    } 
    function approve(address _spender,  uint _value) public returns (bool success) {
        allowance[msg.sender][_spender] = _value;
        emit Approval (msg.sender, _spender, _value);
        return true;
    }    
    function transferFrom (address _from, address _to, uint _value) public returns (bool success) {
        
        require(balanceOf[_from] >= _value, "Not enough money");
        require(allowance[_from][msg.sender] >= _value, "Over permission");
        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;
        allowance[_from][msg.sender] -= _value;
        emit Transfer (_from, _to, _value);
        return true;
    }
}
